import { combineReducers } from "redux";

const initstate = {
  projects: [
    { id: 1, title: "kjfsdljfwljf" },
    { id: 2, title: "lkqkajshejfoijflk" },
    { id: 3, title: "kjfa;lskda;'lk;laskf;sdljfwljf" }
  ]
};

const Reducer = (state = initstate, action) => {
  switch (action.type) {
    case "ADD":
      console.log("created", action.project);
      return state;
    default:
      return state;
  }
};

const rootReducer = combineReducers({
  reducer: Reducer
});

export default rootReducer;
